import React from 'react'

const ProjectsPage = () => {
  return (
    <div className='row container abc'>
      <div className='col '><img src='/images/website.png' class="img-fluid" alt="'Nothing to Preview'"/></div>
      <div className='col '><img src='/images/mobile.png' class="img-fluid" alt="'Nothing to Preview'"/></div>
      
    </div>
  )
}

export default ProjectsPage
